class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        return diff(s, t)
        # return using_dic(s, t)


def diff(s: str, t: str) -> str:
    # 44 ms	13.8 MB
    ch = ord(t[-1])
    length = len(s)
    for i in range(length):
        ch -= ord(s[i])
        ch += ord(t[i])
    return chr(ch)


def using_dic(s: str, t: str) -> str:
    # 56 ms	13.9 MB
    length = len(s)
    if length == 0:
        return t
    table = {}
    for i in range(length):
        ch = s[i]
        if ch in table:
            table[ch] += 1
        else:
            table[ch] = 1

    t_length = len(t)
    for i in range(t_length):
        ch = t[i]
        if ch in table:
            if table[ch] == 0:
                return ch
            table[ch] -= 1
        else:
            return ch

    return ""


if __name__ == '__main__':
    s = Solution()
    print(s.findTheDifference("abcd", "abcde"))
    print(s.findTheDifference("abca", "abcaa"))
    print(s.findTheDifference("abcd", "abcde"))
    print(s.findTheDifference("abcd", "abcdd"))
    a = ""
    b = ""
    print(s.findTheDifference(a, b))
